var returnsEmptyString = require('@timelaps/returns/empty-string');
var objectSet = require('object/set/simple');
var returnsObject = require('@timelaps/returns/object');
var returnsArray = require('@timelaps/returns/array');
var filterCommon = require('array/filter/common');
var negatableFilter = require('array/filter/negatable');
var pushOne = require('array/push/one');
module.exports = negatableFilter(filterCommon(returnsArray, pushOne), filterCommon(returnsObject, function (object, value, key) {
    return objectSet(object, key, value);
}), filterCommon(returnsEmptyString, stringConcat));

function stringConcat(a, b) {
    return a + b;
}
